#include <stdio.h>

int main(){
    char dna[] = "";
    char find[21] = "\0";
    scanf("%[^\n]s", find);
    int counter_1 = 0;
    int counter_2 = 0;
    int counter_3 = 0;
    int exist = 0;
    int index = 0;
    while (dna[counter_1] && !exist){
        counter_2 = counter_1;
        if (dna[counter_1] == find[0])
            while (dna[counter_2] && find[counter_3]){
                if (find[counter_3] != dna[counter_2])
                    break;
                else if (find[counter_3 + 1] == '\0'){
                    exist = 1;
                    index = counter_1;
                }
                counter_2++;
                counter_3++;
            }
        counter_1++;
        counter_3 = 0;
    }
    if (exist)
        printf("Exist [%d]", index);
    else
        printf("Not Exist");
}